const Works = () => {
  return (
    <section id="aboutMe" className="w-full flex flex-wrap justify-center">
      <div className="flex items-center gap-2 w-full">
        <div className="text-white font-semibold text-3xl">
          <span className="text-[#0EE6B7]">#</span>
          works
        </div>
        <div className="w-80 h-[2px] bg-pry-color"></div>
      </div>
      <br />
      <div className="w-full flex flex-wrap"></div>
    </section>
  );
};

export default Works;
